function disableStart(){var n=document.getElementById("btnStart"),t;n.disabled=!0;n.innerText="Running...";t=document.getElementById("ulStatus");t.innerText=""}function enableStart(){var n=document.getElementById("btnStart");n.disabled=!1;n.innerText="Start"}function setupHub(n,t){var i=(new signalR.HubConnectionBuilder).withUrl(n).build();i.on(t,function(n){var t=document.createElement("li");t.textContent=n;document.getElementById("ulStatus").appendChild(t);t.scrollIntoView();n.startsWith("Done in ")&&enableStart()});i.start({withCredentials:!1}).then(()=>console.log("Connection started")).catch(n=>console.log("Error while starting connection: "+n))}